INSERT INTO `page_list` (`id`, `page_title`, `page_content`, `status`) VALUES
(1, 'glowna.html', '<div id=\"content\">\r\n	<span class=\"bigtitle\">Dlaczego warto uprawiać sport? 10 powodów</span><br>\r\n	<h2>1. Aktywność fizyczna poprawia nastrój.</h2>\r\n		Ćwiczenia fizyczne powodują, że wzrasta produkcja tzw. hormonów szczęścia – endorfin. Powstają one w przysadce mózgowej. To właśnie one odpowiadają za radość i szeroki uśmiech, który widać na twarzach sportowców nawet po wyczerpujących zawodach lub treningach.\r\n	<h2>2. Zwiększa zdolności uczenia się</h2>\r\n		Jednym z powodów, dla których warto uprawiać sport, jest jego wpływ na układ nerwowy. Mózg jest nie tylko lepiej ukrwiony i odżywiony. Aktywność fizyczna powoduje, że wzrasta ekspresja białka BDNF, który reguluje działanie neuroprzekaźników i wzmacnia odbiór sygnałów między komórkami nerwowymi.\r\n	<h2>3. Uprawianie sportu podnosi samoocenę</h2>\r\n		Wpływ uprawiania sportu na samoocenę jest związany nie tylko w poprawą wyglądu sylwetki. Dzięki niemu wzrasta wiara we własne możliwości, poprawia się nastrój i samopoczucie, tym samym patrzymy na siebie bardziej przychylnym okiem.\r\n	<h2>4. Zwiększa sprawność mózgu.</h2>\r\n		Sport zwiększa ekspresję białek odpowiedzialnych za funkcjonowanie układu nerwowego – głównie tkanki nerwowej w mózgu. Sprzyja także namnażaniu się komórek nerwowych, co ma wpływ na funkcje poznawcze.\r\n	<h2>5. Ruch poprawia sprawność, wytrzymałość i elastyczności ciała</h2>\r\n		Regularna aktywność fizyczna sprawia, że wzmocnieniu ulegają mięśnie. Poprawia się także wydolność narządów wewnętrznych. Tym samym organizm może dłużej funkcjonować na zwiększonych obrotach.\r\n	<h2>6. Sport wpływa na zdrowie psychiczne</h2>\r\n		Dzieje się tak ze względu na produkcję endorfin, ale także zmniejszenie stresu, lęku i napięcia nerwowego.\r\n	<h2>7. Redukuje stres</h2>\r\n		Za stres odpowiedzialny jest kortyzol. Regularna, umiarkowana aktywność fizyczna zmniejsza jego wydzielanie. Tym samym zmniejsza się napięcie nerwowe. Stajemy się też bardziej odporni na sytuacje stresowe w przyszłości.\r\n	<h2>8. Wzmacnia system immunologiczny</h2>\r\n		Niski poziom kortyzolu nie tylko przeciwdziała stresowi, ale także wpływa pozytywnie na odporność. Układ immunologiczny wzmacnia się również dzięki lepszej pracy serca, do której przyczynia się regularny sport.\r\n	<h2>9. Sprawia, że czujemy się szczęśliwsi</h2>\r\n		Na tą korzyść z uprawiania sportu wpływają wcześniej wspomniane produkcja endorfin i redukcja stresu. Ponadto uczuciu szczęścia sprzyja osiąganie zamierzonych celów i ciągły rozwój, które przy aktywności fizycznej są nieuniknione\r\n	<h2>10. Działa przeciwstarzeniowo</h2>\r\n		Regularny wysiłek fizyczny odmładza nawet o 30 lat. Jest to związane z poprawą wydolności organizmu i redukcją stresu.\r\n	<br><br>\r\n</div>', 1),
(2, 'trening.html', '<div id=\"content\">\r\n	<span class=\"bigtitle\">Trening co słychać?</span>\r\n		<h3>Jesień w pełni 🌞, u mnie to czas na odpoczynek po intensywnym sezonie. Można powiedzieć, że aktualnie  jeżdżę  rekreacyjnie dla przyjemności 😀. Powróciłem teraz  do biegania jako alternatywa dla roweru, w sezonie nie było na to specjalnie miejsca. Natomiast od połowy listopada ruszam do budowania formy na kolejny rok. 💪 Jak tam u was, czy zaczeliście już roztrenowanie?</h3>\r\n	<img class=\"relacje\" src=\"img/jesien.jpg\" />\r\n</div>', 1),
(3, 'relacje.html', '<div id=\"content\">\r\n	<span class=\"bigtitle\">Relacje z wyścigów</span>\r\n	<h3>Czas na nadrobienie zaległości z ubiegłego weekendu 😉\r\n		W niedzielę wystartowałem w wyścigu XCM Miłosna w Kwidzynie. To zawody organizowane przez kolegów z Cyklo Kwidzyn którzy wkładają w to całe swoje serce i mnóstwo prywatnego czasu. Kieruję do was wielkie podziękowania za świetną organizację, zrobiliście kawał dobrej roboty! Do rzeczy, startowałem na dystansie mini 22km,  2 rundy po 11km, charakter typowo XC. W skrócie minimum szutru-> maksimum terenu, single, korzenie, kręte podjazdy i zjazdy. Moja dyspozycja myślę, że była dobra tego dnia, na pewno dobrze się czułem walcząc o podium. Wyścig kończę na 6 msc. Open oraz 1 w kat. 20-29 lat. Za rok na pewno wracam tutaj! \r\n		Tymczasem już w tę niedzielę ostatni wyścig sezonu MTB 2022 czyli ściganie na moim lokalnym podwórku Ogólnopolski Wyścig MTB Susz</h3>\r\n	<img class=\"relacje\" src=\"img/milosna.jpg\" />\r\n	<br><br>\r\n	<h3>LOTTO MTB Energy Olsztyn, 5 msc open & 1 kat M2 . Wyścig prawie na \"swoim podwórku\" przepiękne tereny, single, korzenie to co bardzo lubię w MTB. Trasa bardzo dobrze przygotowana i oznaczona, organizacja na wysokim poziomie 👌Od początku staram się prowadzić pierwszą grupę, jednak tego dnia stawka była mocniejsza ode mnie i urywają mnie z koła na jednym z selektywnych podjazdów. Nadrabiam trochę na singlu kielary, później doganiam Pawła i dalej już idzie dobra robota po zmianach i w równym tempie dojeżdżamy do mety. Na finiszu wiedziałem gdzie zaatakować i tutaj się już wszystko rozwiązało. Dziękuję Pawel Zywicki za współpracę 💪</h3>\r\n	<img class=\"relacje\" src=\"img/lotto.jpg\" />\r\n</div>', 1),
(4, 'kontakt.html', '<div id=\"content\">\r\n	<span class=\"bigtitle\">Kontakt</span>\r\n	<h2>Formularz kontaktowy</h2>\r\n	<div id=\"send_form_status\"></div>\r\n	<form method=\"post\" action=\"send_form.php\" id=\"contact_form\">\r\n		<div><label for=\"name\">Imię i nazwisko</label></div>\r\n		<div><input type=\"text\" name=\"name\" id=\"name\" class=\"formField\" /></div>\r\n		<div><label for=\"phone\">Numer telefonu</label></div>\r\n		<div><input type=\"text\" name=\"phone\" id=\"phone\" class=\"formField\" /></div>\r\n		<div><label for=\"email\">Adres email</label></div>\r\n		<div><input type=\"text\" name=\"email\" id=\"email\" class=\"formField\" /></div>\r\n		<div><label for=\"message\">Treść wiadomości</label></div>\r\n		<div><textarea name=\"message\" id=\"message\" class=\"formField\"></textarea></div>\r\n		<div><button id=\"sendBtn\">Wyślij</button></div>\r\n	</form>\r\n	<br/>\r\n</div>	', 1),
